import React from 'react';

export const Modal = () => {
    document.getElementById("modal").showModal();
}
const FechaModal = () => {
    document.getElementById("modal").close();
}
setTimeout(function() {
    document.getElementById("modal").close();
}, 3000);

const ApesquisaRealizada = () => {

    return(
        <>
            
                <dialog id='modal' onClick={FechaModal}>teste</dialog>
            
        </>
    )
}
export { ApesquisaRealizada }
